import styled from 'styled-components';

const Form = styled.form`
  padding: 1em;
  width: 430px;
  border: solid 1px black;
  label {
    display: block;
    margin-bottom: 0.2em;
  }

  input {
    font-size: 1.5em;
    outline: none;
    box-sizing: border-box;
    width: 100%;
  }

  .form {
    margin-bottom: 1.2em;
  }
`;

export default Form;
